tables.table_schema:
CREATE TABLE user_privacy_settings (
    user_id INT,
    email_privacy BOOLEAN,
    phone_number_privacy BOOLEAN,
    address_privacy BOOLEAN
);

CREATE TABLE user_privacy_settings (
    user_id INT PRIMARY KEY,
    email_privacy BOOLEAN,
    phone_privacy BOOLEAN,
    address_privacy BOOLEAN
);

CREATE TABLE access_logs (
    log_id INT PRIMARY KEY,
    user_id INT,
    accessed_table VARCHAR(255),
    accessed_time TIMESTAMP
);

CREATE TABLE privacy_groups (
    group_id INT PRIMARY KEY,
    group_name VARCHAR(50),
    description TEXT
);

CREATE TABLE user_groups (
    user_id INT,
    group_id INT,
    FOREIGN KEY (user_id) REFERENCES user_privacy_settings(user_id),
    FOREIGN KEY (group_id) REFERENCES privacy_groups(group_id)
);

CREATE TABLE user_personal_info (
  user_id INT PRIMARY KEY,
  full_name TEXT,
  email TEXT,
  phone_number TEXT
);

CREATE TABLE login_history (
  user_id INT,
  login_timestamp TIMESTAMP,
  login_status BOOLEAN
);

CREATE TABLE account_activity (
  activity_id INT PRIMARY KEY,
  user_id INT,
  activity_type TEXT,
  activity_timestamp TIMESTAMP
);
